import React from 'react';
import Typical from 'react-typical';
import './home.scss';
import circles from './assets/Circles.svg';


function home() {
  return (
    <div className="home">
      <header className="home-header">
        <img src={circles} className="home-circles" alt="circles"/> 
          <Typical
          className="title"
          steps={[' Young.', 2000, ' Belgian.', 2000, ' Web-designer.', 2000, ' Freelancer.', 2000, ' Self-learner.', 2000]}
          loop={Infinity}
          wrapper="h1"
          />
        <h3>Lo√Øc Verhaeghe</h3>
      </header>
      <footer>
      <svg width="1920" height="58" viewBox="0 0 1920 58" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M960 57.974L0 58V57.974C0 -32.528 433.36 10 960 10C1486.64 10 1920 -32.528 1920 57.974H960Z" fill="#273040"/>
      </svg>
        <button className="home-button">scroll</button>
      </footer>
    </div>
    );
}

export default home;
